import React from 'react';
import ReactDOM from 'react-dom';

const date = new Date();
const cHour = date.getHours();
let greet = " "

if (cHour >= 1 && cHour <= 11) {
   greet = "Good Morning";
}

else if (cHour >= 12 && cHour <= 17) {
   greet = "Good Afternoon";
}

else {
   greet = "Good Night";
}

ReactDOM.render(
   <>
      <p>{greet}</p>
   </>
   , document.getElementById("root")
);
